def tokenize(source):
    tokens = []
    for char in source:
        if char.isalpha():
            tokens.append(('IDENTIFIER', char))
        elif char.isdigit():
            tokens.append(('NUMBER', int(char)))
        elif char in '+-*/':
            tokens.append(('OPERATOR', char))
    return tokens

